            Int32BinaryTranslation<MutagenFrame, MutagenWriter>.Instance.Write(
                writer: writer,
                item: item.BTXT,
                header: translationParams.ConvertToCustom(RecordTypes.BTXT));
            Int32BinaryTranslation<MutagenFrame, MutagenWriter>.Instance.Write(
